const card = props.myContacts.map((item, pos) => {
	return(
		<div>
			<h2>{item.name}</h2>
			<img src={item.img}/>
			<p>{item.phone}</p>
			<p>{item.email}</p>
		</div>
	)
})

function Cart(props) {
	console.log(props.myContacts[0].email);
	{card}

}

export default Cart;
